Rhode Island

Travel Documentary hosted by Jim Conrad, published by Smithsonian Channel broadcasted as part of Smithsonian Channel - Aerial America series in 2009 - English narration


Information
------------------------------

Join us on an aerial exploration that's short on mileage but long on history. Known as the Ocean State, even though 60% of it is covered in woodland and parks, Rhode Island features 400 miles of pristine tidal shorelines and is the sailing capital of the world. With an incredible array of lighthouses and even more incredible stories of rumrunners, pirates and captains of industry, this small state represents our nation's progress and its excesses. To see it from the sky is to witness a tiny gleaming treasure on America's East Coast.

